import configConstants from '@config/constants'

const {
  API: { baseURL, timeout }
} = configConstants

const params = { name: 'Divine', age: '29', occupation: 'Software Engineer' }

const hhh = Object.entries(params)
  .map((arr) => `${arr[0]}=${arr[1]}`)
  .toString()
  .replaceAll(',', '&')

const URL = `${baseURL}/${'route'}${params && '?'}${hhh}`

const buuks = 'hello'

console.log('buukss', URL)

export default buuks
